import React, {Component} from 'react';


class Table extends Component {;
    render() {
        //console.log("table组件更新搜索词",this.props.filterText)
        let studyFiltered = this.props.study;
        if (this.props.filterText !== '') {
            //使用正则表达式匹配
            studyFiltered = this.props.study.filter((study) => {
                return -1 !== study.patient["patient_id"].search(this.props.filterText);
            });
        }
        return (
            <div class="row">
                <div class="five wide colum">
                        {studyFiltered.map(study=> {
                            return (
                                <div>
                                <h3 class="patientheader">Patient</h3>
                                <h4>{study.patient["patient_id"]}</h4>
                                <h5>Patient ID: </h5>
                                <h5>{study.patient["patient_id"]}</h5>
                                <br />
                                <h5>Patient Gender: </h5>
                                <h5>{study.patient["patient_sex"]}</h5>
                                <br />
                                <h5>Patient Age: </h5>
                                <h5>{study.patient["patient_age"]}</h5>
                                </div>
                            )
                        })} 
                </div>
            </div>
        )
    }
}
export default Table;
